import { BrowserRouter as Router, Route, Redirect, Switch } from 'react-router-dom';
import Homepage from './components/Homepage.js'

function App() {
  return (
    <Router>
      <body>
      <Switch>
          {/* HomePage */}
          <Route exact path="/" component={Homepage}/>
        </Switch>
      </body>
    </Router>
  );
}

export default App;
